async function getData(){return await(await fetch("/json/data.json")).json()}async function buildChart(){try{var t=(await getData())[0],a=t.map(t=>t.element),e=t.map(t=>t.count),o=(console.log(a,e),document.getElementById("myChart").getContext("2d")),n=(new Chart(o,{type:"bar",data:{labels:a,datasets:[{label:"Count",data:e,backgroundColor:"rgba(75, 192, 192, 0.2)",borderColor:"rgba(75, 192, 192, 1)",borderWidth:1}]},options:{scales:{y:{grid:{display:!1},display:!1},x:{barThickness:15,barPercentage:4,categoryPercentage:1,grid:{display:!1}}},plugins:{legend:!1}}}),e.reduce((t,a)=>t+a,0));console.log("Total:",n)}catch(t){console.error(t)}}async function buildChart_2(){try{var t=(await getData())[1],a=t.map(t=>t.day),e=t.map(t=>t.number),o=(console.log(a,e),document.getElementById("lineChart").getContext("2d")),n=(new Chart(o,{type:"line",data:{labels:a,datasets:[{label:"Count",data:e,borderColor:"rgba(75, 192, 192, 1)",borderWidth:3,pointStyle:"circle",pointRadius:4,pointBorderColor:"rgba(75, 192, 192, 1)",pointBackgroundColor:"#fff"}]},options:{scales:{y:{grid:{display:!1},display:!1},x:{grid:{display:!1}}},plugins:{legend:!1}}}),e.reduce((t,a)=>t+a,0));console.log("Total:",n)}catch(t){console.error(t)}}buildChart(),buildChart_2();const labels_1=data.map(t=>t.day),values_1=data.map(t=>t.number),canvas=(console.log(labels_1,values_1),document.getElementById("lineChart").getContext("2d"));function drawLineChart(t){context.strokeStyle="#2dcb71",context.lineWidth=2,context.beginPath(),context.moveTo(0,canvas.height-t[0]);for(var a=1;a<t.length;a++)context.lineTo(a*(canvas.width/(t.length-1)),canvas.height-t[a]);context.stroke()}drawLineChart(data);